-- Tạo databse
create database QLKTX
use QLKTX

-- Xoá database
use master
drop database QLKTX

-- Bảng Phòng
create table Phong (
    maPhong varchar(3) primary key
);

-- Bảng Sinh viên
create table SinhVien (
    maSV varchar(8) primary key,
    hoSV nvarchar(40) not null,
    tenSV nvarchar(10) not null,
    gioiTinh bit default 1,
    ngaySinh date not null,
    lop varchar(20),
    dongPhi bit default 0,
    anhSV nvarchar(300),
    queQuan nvarchar(200),
    sdtSV varchar(15) not null,
    matKhau varchar(30) not null,
    email varchar(100),
    maPhong varchar(3),
    foreign key (maPhong) references Phong(maPhong)
);

-- Bảng Quản lý
create table QuanLy (
    taiKhoan varchar(8) primary key,
    matKhau varchar(30) not null,
    hoQL nvarchar(40) not null,
    tenQL nvarchar(10) not null,
    gioiTinh bit default 1,
    ngaySinh date,
    anhQL nvarchar(300),
    sdtQL varchar(15),
    email varchar(100)
);


